# 3-2-3- Reliability test of variables 

One of the most significant topics in the analysis of time series data is the discussion of stationarity. Prior to discussing mana, it is necessary to distinguish between strict mana and weak mana. Generally, a strictly Mana process is one in which the probability of the sequence $\{Y t\}$ is equal to the probability of the sequence $\{Y t+k\}$ for every $k$. Weak mean processes are defined as follows: a time series that meets the following three conditions is said to be a weak mean process. The following conditions must be met: the mean, variance, and autocorrelation coefficients must remain constant over time. As a result, this means:

$$
\begin{aligned}
& E\left(Y_{t}\right)=\mu \\
& \operatorname{Var}\left(Y_{t}\right)=E\left(Y_{t}-\mu\right)^{2}=\sigma^{2}
\end{aligned}
$$

$$
\operatorname{Corr}\left(Y_{t}, Y_{t-k}\right)=\frac{\gamma_{k}}{\sigma^{2}}=\rho_{k}
$$

To estimate the coefficients of the desired models, traditional and usual econometric methods were used. As a result, variables in the desired model are assumed to be weak, or stable.
